(314, 568, 1, '[color=#ED67EA][b][size=30][p=center]Uzaklaştırma cezasının sebepleri neler olabilir?[/p][/size][/b][/color]\n[b][color=#CB546B]1-[/color][/b] Hile yaparsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]2-[/color][/b] Hile dağıtırsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]3-[/color][/b] Hile ararsanız [Hile dilenmek] uzaklaştırılabilirsiniz.\n[b][color=#CB546B]4-[/color][/b] Dolandırıcılık yapmaya çalışırsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]5-[/color][/b] Irkcı ithamlarda bulunursanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]6-[/color][/b] Oyun açıklarını suistimal ederseniz uzaklaştırılabilirsiniz.\n[b][color=#CB546B]7-[/color][/b] Oyun ile ilgili gizli bilgileri paylaşırsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]8-[/color][/b] Uygunsuz link (p*rno, warez vs.) gibi linkler paylaşırsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]9-[/color][/b] Herhangi bir şekilde ban cezası almanız halinde, ban süreniz bitmeden oyuna farklı bir hesapla girdiğiniz tespit edilirse ve [u]aynı hareketleri yapmaya devam ederseniz[/u] farklı olan bir hesabınız Ban Evasion sebebiyle uzaklaştırılabilir.\n[b][color=#CB546B]10-[/color][/b] Bir şekilde susturma cezası almış iseniz, ve ceza süreniz bitmeden oyuna farklı bir hesapla girer ve [u]aynı hareketleri yaparak[/u] konuşmaya devam ederseniz uzaklaştırılabilirsiniz.\n[b][color=#CB546B]11-[/color][/b] Başka sunucuların reklamını [u][link halinde][/u] yaparsanız uzaklaştırılabilirsiniz. Eğer link halinde reklamını yaparsanız banlanırsınız, [u]bahsederseniz[/u] önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#CB546B]12-[/color][/b] Spambot yaparsanız uzaklaştırılabilirsiniz.\n[b][color=#CB546B]13-[/color][/b] Rahatsız edici kullanıcı adları içeren hesaplar açarsanız açtığınız o hesapta uzaklaştırılabilirsiniz.\n[b][color=#CB546B]14-[/color][/b] Farm yaparsanız uzaklaştırılabilirsiniz.\n[hr]\n[color=#FEB1FC][b][size=30][p=center]Susturma cezasının sebepleri neler olabilir?[/p][/size][/b][/color]\n[b][color=#98E2EB]1-[/color][/b] Flood (aynı yazıyı sık aralıklarla tekrarlamak) yaparsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]2-[/color][/b] Spam (hiçbir anlamı olmayan harf-sayı dizemi) yaparsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]3-[/color][/b] Küfür ve hakaret ederseniz önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]4-[/color][/b] Yanlış bilgilendirme yaparsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]5-[/color][/b] Yetkililerin görevlerini yapmasını engellerseniz önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]6-[/color][/b] Yetkililere küfür ve hakaret ederseniz önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]7-[/color][/b] Sürekli büyük harflerle yazarsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]8-[/color][/b] Provokasyon yaparsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]9-[/color][/b] Moderatör taklidi yaparsanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]10-[/color][/b] Çıplak fotoğraf isterseniz önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]11-[/color][/b] Başka sunuculardan bahsederseniz önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]12-[/color][/b] TR serverinde yabancı dilde konuşursanız önce uyarılmak şartıyla susturulabilirsiniz.\n[b][color=#98E2EB]13-[/color][/b] Diğer oyunculara kışkırtıcı tavırlar sergilerseniz önce uyarılmak şartıyla susturulabilirsiniz.\n\nBan ve susturulma cezası süreleri yazılmamıştır, süreler olaylara, bulunulan odalara ve kişinin ceza geçmişine göre değişkenlikler gösterir.', 'Ciss', '1554145673000', '0', '0'),
(313, 567, 1, '[p=center][color=#C2C2DA][font=soopafresh][size=30][color=#7bf47e][b]Sorular ve Cevaplar Başlığına \nHoş Geldiniz![/b][/color][/size][/font][/p]\n\n\n[p=center]Bu konu, Vampirmice forumları veya oyunları hakkında merak ettiğiniz herhangi bir soruyu sormanız için burada! \nEğer sorulan bir soru hakkında bilginiz varsa, bu sorulara cevap da verebilirsiniz. [/p]\n\n[p=center][font=soopafresh][size=25][color=#7bf47e][b]Genel Kurallar[/b][/color][/size][/font][/p]\n\n[list][*][b]Mümkün olduğunca açıklayıcı olun. Sorunuzu ne kadar net anlatırsanız, o kadar net bir cevap alırsınız![/b][/*]\n[*][b]Doğru imla ve dilbilgisi kullanın.[/b] Kötü kurulmuş cümlelerin okunması kolay olmayacaktır.[/*]\n[*][b]Lütfen cevabınızın doğru olduğundan emin olun![/b] Soru soran kişinin kafasını karıştırmamak için verdiğiniz cevabın %100 doğru olduğuna emin olmanız daha faydalı olacaktır.[/*][/list]\n\n[hr]\n[p=center][font=soopafresh][size=25][color=#7bf47e][b]Sıkça Sorulan Sorular[/b][/color][/size][/font][/p][hr]\n[font=soopafresh][size=20][color=#7bf47e][b]Oyun-oynanışı Hakkında/Genel Sorular[/b][/color][/size][/font]\n\n[b][i]Moderatör olabilir miyim?[/i][/b]\nBaşvurular şu anda açık değil. Başvuruları açtığımız zaman Vanpirmice - Tartışmalar alt forumunda duyurusu olacaktır. Bu yüzden takipte kalın!\n\n[b][i]Bir hileci yakaladım! Onu nasıl rapor edebilirim?[/i][/b]\nRapor sistemini kullanarak hile kullanan kişileri rapor edebilirsiniz. Sohbet kutusundan ya da oyuncu listesinden kullanıcı ismine tıklayıp &#34;Rapor&#34;u seçiniz. Bu kullanıcıları, direkt &#34;/report [kullanıcıadı]&#34; komutunu kullanarak da rapor edebilirsin. Alternatif olarak, doğrudan çevrimiçi bir moderatörle oyun içinden iletişime geçebilirsin. \n(/mod komutunu kullanarak &#34;Çevrimiçi Moderatörler&#34; listesine ulaşabilirsiniz.)\n\n[b][i]Ne zaman birinciliklerim/peynirlerim/kurtarmalarım sayılır?[/i][/b]\nBirincilikler: 10 fare + şaman (11)\nTurlar: 2 fare\nKurtarmalar: 3 fare\nPeynirler: 2 fare\nNot: Odadaki her fare farklı bir IP&#39;den girmiş olmalıdır. 10 tane yan hesap kullanmanız, size birincilik kazandırmayacaktır.\n\n[b][i]Modül nedir?[/i][/b]\nModüller, # ile başlayan belirli odalarda oynanabilen ve kullanıcılar tarafından oluşturulan mini oyunlardır. Bunların bazılarını oyun içinde &#34;Oda listesi&#34; butonuna tıklayıp &#34;Modül&#34; sekmesinde görebilirsiniz. Lua kullanılarak yaratılan bu modüller hakkında daha fazla bilgiyi Modüller Alt Forumu[/url]nda bulabilirsiniz.\n\n[b][i]Transformice&#39;ı tam ekran olarak nasıl oynayabilirim?[/i][/b]\nOyun içinden &#34;Tam Ekran&#34; butonuna basarak  Transformice&#39;ı tam ekran olarak oynayabilirsin. Ayrıca, oyunun Standalone&#39;u indirebilirsin, böylece tarayıcıdan oynamak zorunda kalmazsın. Daha fazla bilgi için tık!\n\n[b][i]Bir odadaki üyeler tarafından banlandım, ne yapmalıyım?[/i][/b]\nEğer oyuncular sizi /ban komutu ile banladıysa, sadece 1 saatliğine o odadan uzaklaştırılmış olursunuz. Herkesin istediği zaman trollük yapanları banlama hakkı vardır, moderatörler banını aç(a)mayacaktır. Lütfen sadece 1 saat bekleyiniz. Eğer diğerlerinin sizi sebepsiz yere banlamaya çalıştığını düşünüyorsanız burada listelenen moderatörlerden birine oyundan veya forumdan mesaj atın.\nDipnot: Bu kural özel odalarda daha esnektir, insanlar bir özel odada sizi istemiyorsa banlayabilirler.\n\n[b][i]Biri beni sürekli rahatsız ediyor, ne yapmalıyım?[/i][/b]\nRahatsız eden kişiyi &#34;/mute [kullanıcı adı]&#34; ([kullanıcı adı] yazan kısma sizi rahatsız eden kişinin oyundaki kullanıcı ismi yazılacak) komutunu kullanarak oyuna yeniden girene kadar susturabilirsiniz. Oyuna yeniden girene kadar susturduğunuz kullanıcının yazdığı hiçbir yazıyı (kabile hariç) görmezsiniz. Aşırı derece küfür edildiğini düşünüyorsanız /report komutunu kullanarak bu kişileri rapor edebilirsiniz.\n\n[i][b]Bir moderatör ile nasıl iletişime geçebilirim?[/b][/i]\n/mod yazarak çevrimiçi moderatörlerin listesini bulabilirsiniz ve onlara özel mesaj atabilirsiniz ya da forum özel mesaj sistemini kullanarak onlara özel mesaj atabilirsiniz -bu yol daha etkili olacaktır-. Alternatif olarak, Resmi moderatörleri bulabilirsiniz.\n\n[b][i]Sınırsız banlanmam için kaç kere ban yemeliyim?[/i][/b]\nArtık sınırsız banlanmak için belirli bir saat süresi yok. Uygun görüldüğünde sınırsız/kalıcı uzaklaştırma verilir. (Ör: Çok fazla kural dışı davranışta bulunduğunuz zaman.)\n\n[b][i]X unvanı için kaç peynire ihtiyacım var?[/i][/b]\nUnvanların listesini ve sahip olma kriterlerini burada bulabilirsiniz.\n\n[b][i]Benim ülkem için bir topluluk oluşturabilir misin?[/i][/b]\nTopluluklar, eğer o ülkede yeterli sayıda kişi Transformice&#39;ı oynuyorsa adminler tarafından oluşturulabilir. Yöneticiler çok kesin istatistiklere erişebilir, bu nedenle ülkeniz için bir topluluğa ihtiyaç duyulursa oluşturulacaktır!\n\n[b][i]Kabileler nedir?[/i][/b]\nKabileler, küçük arkadaş gruplarıdır. Özel sohbetleri ve kabile evi gibi farklı ilginç özellikleri vardır. Kabileler hakkında daha fazla bilgi edinmek için Kabileler Alt Forumu na bir göz atabilirsiniz!\n\n[b][i]Bir kabileye nasıl katılabilirim?[/i][/b]\nMevcut bir kabileye katılmak istiyorsanız, o kabilede alım yetkisi olan bir kişi tarafından davet edilmelisiniz. Kabileler Alt Forumu nda spesifik olarak kabileler için kurulmuş konular üzerinden kabileye girme koşullarını ve kiminle konuşacağını öğrenebilir ya da bu konu ya mesaj atabilirsiniz.\n\n[b][i]Nasıl çilek satın alabilirim?[/i][/b]\nÜlke şartlarına göre farklı çilek alım yolları vardır. Bu satın alma seçeneklerine oyunda market kısmından &#34;Çilek al&#34; botununa tıklayarak ulaşabilirsiniz. Nerede olursanız olun, seçtiğiniz satın alma seçeneğindeki talimatları çok dikkatli bir şekilde izleyin. Çilek alım sorunu yaşıyorsanız bu konu ya bir göz atabilirsiniz.\n\n[b][i]Kullanıcı adımı nasıl +&#39;lı yapabilirim?[/i][/b]\nBu artık mümkün değil. Kullanıcı adlarının başında + işareti olan hesaplar, daha önce başka bir oyunda bulunan oyunculardır. (extinction.fr)\nHesaplar Transformice ile birleştirildi ve isim çakışmalarından kaçınmak için önüne + koydular.\n\n[font=soopafresh][size=20][color=#7bf47e][b]Forum Hakkında Sorular[/b][/color][/size][/font]\n\n[b][i]Sentineller kimdir? Nasıl sentinel olabilirim?[/i][/b]\nSentineller forum moderatörleridir. Oyun içerisinde yetkileri yoktur. Bir sentinel olabilmenin en iyi yolu genellikle forumlarda aktif, arkadaş canlısı ve yardımsever olmaktan geçiyor. Vampirmice Tartışmalar Alt forumu[/url]na bir göz atın; Sentinel başvuruları açıldığı taktirde oradan ilan edilecektir.\n\n[b][i]Sentineller ile nasıl iletişim kurabilirim?[/b][/i]\nSentinellere forumdan veya oyundan özel mesaj gönderebilir ya da  Resmi TFM Discord serverı[/url]nı ziyaret ederek iletişime geçebilirsiniz. \n\n[b][i]Nasıl avatar değiştirebilirim/yükleyebilirim ?[/i][/b]\nAvatarınızı profil sayfanızdan (nickinizin yanındaki açılır menüde Profilim sayfasına giderek) adınızın solundaki çark simgesine tıklayıp Avatarımı Değiştir&#39;i seçerek değiştirebilirsiniz.\n\n[i][b]Forum içerisinde nasıl arama yapabilirim?[/b][/i]\nEn üst taraftaki gezinti çubuğunda bulunan Arama düğmesini kullanarak arama yapabilirsiniz.\n\n[i][b]Üstü çizili yazıları, renkli metinleri, bağlantılı linkleri ve benzerlerini nasıl yapabilirim?[/b][/i]\nForum Rehberi  konusu, forum özelliklerini kullanma ile ilgili tüm bilgileri içermektedir.\n\n[font=soopafresh][size=20][color=#7bf47e][b]Sorun Giderme/Destek Hakkında Sorular[/b][/color][/size][/font]\n\n[b][i]Bir hata/oyun açığı buldum! Nasıl rapor edebilirim?[/i][/b]\nHataları, Hatalar Alt Forumu nda bildirebilirsin. Konu açmadan önce Hatalar Listesi nden o hatanın raporlanıp raporlanmadığını kontrol etmelisiniz.\n\n[b][i]Sunucuya bağlanamıyorum/Oyun yüklenmiyor! Yardım edin![/i][/b]\nLütfen 15-30 dakika içerisinde oyuna bağlanmayı tekrar dene. Hala sorun yaşıyorsanız Hatalar Alt Forumu nu ziyaret ederek sunucu kaynaklı bir sorun olup olmadığını kontrol edebilirsiniz. Sorun sunucu kaynaklı değilse bu konu altından bildirebilirsiniz.\n\n[b][i]Şifremi değiştirebilir miyim?[/i][/b]\nOyun ve forum şifreleriniz aynıdır. Şifrenizi; foruma giriş yaptıktan sonra, isminizin yanındaki açılır pencerede Hesabım sayfasına giderek değiştirebilirsiniz.\n\n[b][i]E-posta adresimin şifresini unuttum ve şifremi değiştiremiyorum. Ne yapmalıyım?[/i][/b]\n İletişim formu aracılığıyla bir yönetici ile iletişime geçin, onlar hesabınızla ilişkili olan e-posta adresini değiştirebilirler. Formu doldurmak için bu konu[/url]dan yararlanabilirisiniz.\n\n[b][i]Oyunla ilgili gerçekten müthiş bir önerim var! Bunu nasıl paylaşabilirim?[/i][/b]\nBir öneriniz varsa Öneriler Alt Forumu[/url]nda paylaşabilirsiniz.\n[hr]\n[size=16][p=center]Bu sorular dışında oyun ve forum hakkındaki sorularınızı bu konu altından sorabilirsiniz. [/p][/size][hr]', 'Ciss', '1554145620000', '0', '0'),
(314, 569, 2, '[b][color=#E68D43][u]Farm nedir?[/u][/color][/b]\n\n“Farm” veya "farming" terimleri, Supermice''de yasaklanmış metodlar kullanılarak, oyuncuların profillerinde yüksek değerlere ulaşmalarını tanımlamak için kullanılır. Farming, adminler tarafından yasaklanmıştır; çünkü farm yapan oyuncular, yapmayanlar karşısında haksız bir üstünlüğe sahip olmaktadırlar. Bir oyuncunun farm yapıyor sayılabileceği durumlar: Yanlış bilgilendirme, sahte etkinlik duyuruları, uygunsuz reklam içeriği ve tüm diğer benzer uygulamalar. Aşağıda belirlenmiş listedeki farm türleri YASAKLANMIŞTIR: \n\n[list] • Çeşitli ziyaretçi hesaplarının kullanımı\n• VPN kullanımı\n• Oyun açığı suistimali\n• Düzensiz/kalabalık odalar oluşturmak\n• /silence komutunu reklam amaçlı kullanmak.\n• Çeşitli mesajlar ve sahte vaatler ile oyuncuları kandırmaya çalışmak.\n• Sahte etkinlik oluşturmak, çilek önermek, çekilişler oluşturmak ve diğer her türlü gerçek dışı ve kurallara aykırı girişimler.[/list]\n\n[b][color=#E68D43][u]Sıkça sorulan sorular[/u][/color][/b]\n\n• Bir oda oluşturup, benimle oynamaları için arkadaşlarımı çağırabilir miyim?\n- Evet. odanızın reklamını sohbetlerde yapmadığınız ve odanız bir karışıklığa sebep olmadığı/kontrolden çıkmadığı sürece; arkadaşlarınızla oynamak için bir oda oluşturabilirsiniz. \n\n• Bir ünvan kazanmak veya profilimdeki olağanüstü bir sayıyı kutlamak için bir oda yaratabilir miyim?\n- Evet, sahte mesaj, etkinlik, vaat veya /silence komutu ile reklam yapmadığınız sürece. Bu tarz odaları, bir ünvan almaya veya belirlediğiniz sayıya ulaşmanıza YAKINSANIZ oluşturabilirsiniz. Bu sebeple; iyi hesaplayın, eğer hedefinize ulaşmaya yakın değilseniz oda oluşturmayın ve unutmayın ki sayılarınızı veya ünvanlarınızı kutlamak için oda açabilmeniz, her 1 veya 2k kurtarmanızda/birinciliğinizde/peynirinizde oda oluşturmanızı gerektirmez. Sadece erişeceğiniz "önemli bir başarıyı" kutlamak için oda oluşturmalısınız!\n\n• Bir oda yaratıp, büyük miktarda oyuncunun odama gelmesini sağlamak amacıyla sohbette paylaşabilir miyim?\n- Hayır, bunu yaparsanız düzensiz/kalabalık/karmaşık bir oda oluşturmuş olursunuz ve buna izin verilmemektedir. \n\n• Odanın reklamını yapan bir oyuncu var, ama ben oda ismini başkalarına yaymıyorum. Banlanır mıyım?\n- Hayır, sadece odayı başkalarına yayan kişiler cezalandırılır. Ama eğer siz veya diğer oyuncular odayı farm yapmak için kullanıyorsanız, reklam yapmıyorsanız bile ceza alırsınız. \n\n• 0 puanlı bir odaya gidip, başka farelerin katılmasını bekleyebilir miyim?\n- Evet, yapabilirsiniz; çünkü bu artık bir farm metodu olarak kabul edilmemekte. \n\n• Youtube kullanıcısıyım. Bir oda oluşturup, kanalıma abone olan kişileri odama çağırıp video çekebilir miyim?\n- Evet, /silence komutunu kullanarak, sahte mesajlar/etkinlikler/vaatler ile oyuncuların odaya katılımını sağlamadığınız sürece. \n\n• Birden fazla kayıtlı hesabı aynı anda kullanırsam banlanır mıyım?\n- Evet. Bu hesaplar ziyaretçi olmayan hesaplar olsalar ve hatta değişik IP adreslerine sahip olsalar bile, birkaç değişik hesabı eş zamanlı kullanamazsınız. Çoklu hesap kullanan oyuncular kurallara karşı gelmiş kabul edilir.', 'Ciss', '1554145701000', '0', '0'),
(314, 570, 3, '[size=25][b][color=#2E72cb]Glitch nedir?[/color][/b][/size]\n\n"Glitch" veya "Glitching"; bir oyuncu, sistemde ya da oyunda var olan düzeltilmemiş bir hatayı suistimal ettiğinde kullanılan bir terimdir (Oyun açıklarından faydalanmak). Glitch''leri kullanmak veya suistimal etmek kurallara aykırıdır ve bunu yaptığınız için cezalandırılabilirsiniz.\n\n[b]Lütfen dikkat edin: Diğer oyunculara karşı haksız üstünlük yarattığı için glitch''lerin kullanımı yasaktır. Glitch çeşidine bağlı olarak bir moderatör tarafından uyarılabilir ve hatta banlanabilirsiniz ya da voteban ile odadan atılabilirsiniz, oyun kurallarında da bahsedildiği gibi..\n\nAşağıdaki Glitch''lerin kullanımı yasaktır:[/b]\n[list] • ESC butonuna basılarak haritanın işleyişini durdurmak;\n• Mulodrome;\n• Pencereyi küçültmek;\n• Glitch kullanarak bir profilin ünvanlarını, peynirlerini ve çileklerini bir başka profile geçirmek.[/list][/quote]', 'Ciss', '1554145714000', '0', '0'),
(314, 571, 4, '[p=center][size=30][b][color=#30ba76]Raporlama Yapmak ve Oylama ile Uzaklaştırmak?[/color][/b][/size][/p]\n\nSelam fareler. Bir çok oyuncu oyunda gereksiz raporlamalar yapıyor, bir çok kullanıcı gereksiz veya keyfi sebeplerden dolayı odadan oy birliği ile uzaklaştırmalar yapıyor ve hatta raporlama sebeplerinden bazen alakası dahi olmayan sebepler işaretliyor. Bu da tabii ki yetkililerin işini hayli yavaşlatıyor ve onları demoralize ediyor. İşte bu rehberi hazırlamama etken olan da bu. Bu konuyu eksiksiz okuduktan sonra bir oyuncunun raporlama ile uzaklaştırma alması gereken durumları, oy birliğiyle uzaklaştırma alması gereken durumları ve bir oyuncuyu raporlarken hangi seçeneği işaretlemeniz gerektiğini öğreneceksiniz.\n\n[p=center][size=30][b][color=#babd2f]Raporlama Yapmak[/color][/b][/size][/p]\n\n1-Raporlamak istediğiniz oyuncu eğer yazı yazmışsa sohbet panelinden ismine tıklayarak.\n2-Oyuncu listesinden ismine tıklayarak.\n3- /report [kullanıcı adı] komutunu kullanarak.\n\nRaporlarınızın oyun içi düzeni sağlamakla yükümlü olan moderatörlere ulaşmasını sağlamak için raporlanması gerektiğini düşündüğünüz kişinin odasından en az 2 kişinin bu kişiyi raporlaması gerekir. Raporunuz yalnızca kendi topluluğunuzun moderatörlerine ulaşmaz, tüm toplulukların moderatörlerine raporunuz ulaşır. Gereksiz/keyfi raporlamalar yapmanız halinde raporlarınız bir süre sonra göz ardı edilir. Bu yüzden raporlama yaparken dikkatli olun.\n\nRaporlama seçeneklerinin seçimi zorunludur. Şikayetin doğru nedenini seçtiğinizden emin olun, örneğin hile yapan birini raporladığınız zaman "Hile" seçeneği yerine "Spam/Flood" seçeneğini işaretlerseniz hile yapan kullanıcının uzaklaştırılması gecikebilir veya dikkate alınmayabilir. Bu nedenle raporlama yaparken doğru sebebi seçtiğinizden emin olun.\n\n[p=center][size=30][b][color=#babd2f]Raporlama Seçenekleri[/color][/b][/size][/p]\n\n[color=#babd2f]Hile:[/color]\nOdanızda harita başlar başlamaz yuvaya giren, havada özgürce uçabilen, portallarla yer değiştiren, yüzlerce top güllesi atan bir fare gördüyseniz bu seçenek tam size göre.\n\n[color=#babd2f]Spam / Flood:[/color]\nAynı veya benzer bir mesajı tekrar tekrar yazan bir oyuncu gördüğünüzde onu raporlamanız gereken en iyi seçenek bu seçenektir. Özel mesajlaşmada, sohbet odalarında, kabile konuşmalarında raporlama yapmayın. Örneğin /room 1, /room 2, /room vanilla1, /room bootcamp1 vb. odalarda spam ya da flood yapan birini gördüyseniz raporlama yapabilirsiniz.\n\n[color=#babd2f]Hakaret:[/color]\nOyundaki kullanıcıların büyük çoğunluğu aşırı derecede küfürler ediyor. Bazı oyuncular birbirlerine şakayla karışık hakaretler ediyorlar bu durumlarda raporlama yapılmamalıdır. Bir oyuncu aşırı derecede küfür etmediği sürece raporlama yapmayın. Ayrıca özel odalarda ki küfürlü konuşmalara moderatörler karışmaz. Bu yüzden özel odalarda edilen küfürleri de raporlamamanız gerektiğini bilmelisiniz. Bunları yapan kullanıcıyı engelleyere kısa ve kolay yoldan çözüme ulaşabilirsiniz.\n\n\n[color=#babd2f]Dolandırıcılık:[/color]\nPhishing doğrudan belirli referanslar dağıtarak ya da dilenerek diğer oyunculardan şifre veya para kazanmak için bir girişimdir. Bir oyuncu ücretsiz çilek-peynir vaatleriyle verilmiş hileli form siteleleri ya da virüslü bir site yolladığı zaman raporlama yapabilir ve bu seçeneği işaretleyebilirsiniz.\n\n[color=#babd2f]Diğer:[/color]\nRaporlamanız gereken oyuncuyu hile, spam/flood, hakaret veya dolandırıcılık sebebiyle değilde başka bir sebeple raporlamak istiyorsanız bu seçeneği işaretlemelisiniz. Bu seçeneği işaretledikten sonra yorum kısmına gerekli açıklamayı yapmalısınız.\n\n[color=#babd2f]Yorum:[/color]\nŞikayet sebebinizi bu kısımda daha detaylı anlatabilir, yetkililerin şikayet sebebinizi tam olarak anlamasına yardımcı olabilirsiniz. Eğer raporlama nedeni olarak "Diğer"i işaretlerseniz yorum kısmına gerekli açıklamayı yapmalısınız. Örneğin gördüğünüz bir hilecinin videosunu çektiyseniz video linkini buraya yazabilir oyuncunun uzaklaştırma almasını sağlayabilirsiniz.\n\n[p=center][size=30][b][color=#babd2f]Oylama ile Uzaklaştırmak[/color][/b][/size][/p]\n\nBir oyuncuyu odanızdan uzaklaştırmak için "/ban [Kullanıcı adı]" komutunu kullanın, söz konusu kişinin odadan uzaklaşması için toplamda 10 oy alması gereklidir. Oyların geçerli olması için farklı IP adreslerinde olmak ve uzaklaştıracağınız kullanıcı ile aynı odada olmak zorundasınız, farklı bir odadan atılan oylar geçersizdir. 10 kişi bu komutu bir kullanıcı üzerinde uygularsa o kişi bir saatliğine odadan uzaklaştırılır ve sunucu tarafından "*badgirls" odasına yollanır.\n\nBu komutu keyfi yere kullanırsanız moderatörler tarafından "voteban suistimali" sebebiyle oyundan uzaklaştırılırsınız. Örneğin bir oyuncu birinciliğinizi aldı diye onu uzaklaştırmanız suistimal olur ve tespiti halinde uzaklaştırma alırsınız. Uzaklaştırmaların bir kısmını şamanların trollükleri oluşturmaktadır. Trollük bu oyunun bir parçasıdır engellenemez. Eğer bir şaman trollük yapıyorsa moderatörlere şikayet etmemelisiniz. Moderatörler hiç bir müdahalede bulunmazlar. Eğer o oyuncu sizi ve diğer oyuncuları trollük yaptığı için çok kızdırdıysa banlayabilirsiniz. Özel odada istemediğiniz bir oyuncuyu uzaklaştırma hakkına da sahipsiniz.\n\nOdanızda sizi rahatsız eden bir oyuncu varsa onu konuşma penalinden veya kişi listesinden ismine tıklayarak ya da "/mute [Kullanıcı adı]" komutunu kullanarak engelleyebilirsiniz. Hakaretler savuran, spam/flood yapan bir oyuncuyu raporlamak yerine onu engelleyerek kendiniz çözüm bulabilirsiniz.\n\nBu talimatlar oyun kuralları gelişimine uygun olarak takviye edilebilir.', 'Ciss', '1554145732000', '0', '0'),
(315, 572, 1, '[p=center][font=Soopafresh][size=40][color=#a8cc46]Uzaklaştırma/Susturma İtiraz Bilgilendirmesi[/color][/size][/p]\n\n[b]Oyunda haksız bir şekilde susturuldum/uzaklaştırıldım, buna nasıl itiraz edebilirim?[/b]\n\n[list]\n[*][b]Bu konu hakkında direkt olarak bir moderatöre ulaşmanız gerekecek.[/b] Bizden birine forumda özel mesaj atabilirsiniz ya da bizimle Transformice Discord sunucusu üzerinden konuşabilirsiniz (yönlendirmeler için Discord Kullanımı  rehberine bakabilirsiniz). Lütfen bu konu hakkında forumda konu [u]açmayın[/u] ya da ileti [u]göndermeyin[/u]. Moderatörlerin, ceza geçmişinizi forumda kontrol edebilecek araçları yoktur, ayrıca uzaklaştırma ve susturma itirazları yalnızca ekip ve oyuncu arasında konuşulması ve çözülmesi gereken bir şeydir.\n[*][b]Yapabileceğiniz en iyi şey olay hakkında mümkün olduğunca çok detay toplamaktır.[/b] Durumunuzu elinizden geldiğince çok detaylar ile tarif etmek bize çok kolaylık sağlıyor. Moderatörler de hata yapabilir ancak bir oyuncunun kurallara uymadığına kesinlikle emin olmadan onları oyundan uzaklaştırmayız. Olay ile ilgili ekran görüntüsü ya da video varsa itirazınızı desteklemek için bize gönderebilirsiniz ama resimler ve videolar kolaylıkla değiştirilebildiği ve üzerlerinde photoshop yapılabildiği için kesin kanıt olarak kabul [u]edilemezler[/u].\n[*][b]Bir susturma ya da uzaklaştırma cezası kaldırma kararını sadece o cezayı uygulayan moderatör verebilir.[/b] Bazı durumlar ekipteki diğerleri ile görüşülebilir ve biz sıklıkla bazı durumlar hakkında birbirimizin görüşünü alıyoruz, ancak susturma cezasını veren moderatör bu kararı vermek için gerekli görsel kanıta sahip olan tek kişidir ve bu yüzden kararı da sadece o kaldırabilir. Farklı bir sonuç için herkesin görüşünü sormak işe yaramaz ve herkesin vaktini boşa harcar.\n[*][b]Hesabınız ve detayları için siz sorumlusunuz.[/b] Hesabınız hiçbir şekilde zorla ele geçirilemez. Eğer hesabınızın güvenliği tehlikedeyse, bunun sebebi ya şifrenizin kolaylıkla tahmin edilebilir olmasıdır, ya şifrenizi hesabınıza kendisi erişmek için kullanan veya başkalarına dağıtan birine vermiş olmanızdır ya da detaylarınızı, şifrenizi çalmak için tasarlanmış güvenilir olmayan üçüncü parti sitelere girmiş olmanızdır. Hileyi yapanın kardeşiniz olduğunu söylemeniz ya da kuralları bozanın başka biri olduğunu söylemeniz cezanın açılmasını sağlamaz.\n[*][b]Sonuç sizi hâlâ memnun etmediyse, itirazınızı adminlere taşıyabilirsiniz.[/b] Bunu yapmak için İletişim sayfasındaki formu doldurmanız gerek. Bu formu doğru bir şekilde doldurmak için gerekli yardımı ve ipuçlarını burada bulabilirsiniz.[/list]\n\n\n\n[b]Forumda haksız bir şekilde susturuldum, buna nasıl itiraz edebilirim?[/b]\n\n[list]\n[*][b]Bu konu hakkında direkt olarak bir sentinele ulaşmanız gerekecek.[/b] Bizden birine forumda özel mesaj atabilirsiniz ya da bizimle Transformice Discord sunucusu üzerinden konuşabilirsiniz (yönlendirmeler için Discord Kullanımı  rehberine bakabilirsiniz). Lütfen bu konu hakkında forumda konu [u]açmayın[/u] ya da ileti [u]göndermeyin[/u]. Susturma itirazları yalnızca ekip ve oyuncu arasında konuşulması ve çözülmesi gereken bir şeydir ve sonuç olarak forumda gerçek konuşmaların olmasını engeller. \n[*][b]Yapabileceğiniz en iyi şey olay hakkında mümkün olduğunca çok detay toplamaktır.[/b] Durumunuzu elinizden geldiğince çok detaylar ile tarif etmek bize çok kolaylık sağlıyor. Susturmalar geçerli bir gerekçe olmadan verilmez ancak bazı durumların yanlış yorumlanması ve yanlış anlaşılması, forumun öznel doğasından dolayı, her zaman mümkündür. Olay ile ilgili ekran görüntüsü varsa itirazınızı desteklemek için bize gönderebilirsiniz ama resimler kolaylıkla değiştirilebildiği ve üzerlerinde photoshop yapılabildiği için kesin kanıt olarak kabul [u]edilemezler[/u].\n[*][b]Bir susturma ya da uzaklaştırma cezası kaldırma kararını sadece o cezayı uygulayan sentinel verebilir.[/b] Bazı durumlar ekipteki diğerleri ile görüşülebilir ve biz sıklıkla bazı durumlar hakkında birbirimizin görüşünü alıyoruz, ancak susturma cezasını veren sentinel bu kararı vermek için gerekli görsel kanıta sahip olan tek kişidir ve bu yüzden kararı da sadece o kaldırabilir. Farklı bir sonuç için herkesin görüşünü sormak işe yaramaz ve herkesin vaktini boşa harcar.\n[*][b]Hesabınız ve detayları için siz sorumlusunuz.[/b] Hesabınız hiçbir şekilde zorla ele geçirilemez. Eğer hesabınızın güvenliği tehlikedeyse, bunun sebebi ya şifrenizin kolaylıkla tahmin edilebilir olmasıdır, ya şifrenizi hesabınıza kendisi erişmek için kullanan veya başkalarına dağıtan birine vermiş olmanızdır ya da detaylarınızı, şifrenizi çalmak için tasarlanmış güvenilir olmayan üçüncü parti sitelere girmiş olmanızdır. Spam konular açanın kardeşiniz olduğunu söylemeniz ya da kuralları bozanın başka biri olduğunu söylemeniz cezanın açılmasını sağlamaz.\n[*][b]Sonuç sizi hâlâ memnun etmediyse, itirazınızı adminlere taşıyabilirsiniz.[/b] Bunu yapmak için İletişim sayfasındaki formu doldurmanız gerek. Bu formu doğru bir şekilde doldurmak için gerekli yardımı ve ipuçlarını burada bulabilirsiniz.[/list][/quote]', 'Ciss', '1554145783000', '0', '0'),
(316, 573, 1, '[p=center][b]Merhaba fareler, burada kurallara uymak şartı ile, arkadaşlarınız ve diğer farelerle dilediğiniz gibi sohbet edebilirsiniz.[/b][/p][p=center]\n[img]https://i.hizliresim.com/LOkRRb.gif[/img][/p]', 'Ciss', '1554146864000', '0', '0'),
(317, 574, 1, 'Bu subforum forum oyunları oynayabilmeniz içindir. Bu subforumun SuperMice ile alakalı olması gerekmez.\n\n[b]1. Xe kadar sayalım! oyunları yok.[/b]\nBu tür oyunlar için emek ve çaba sarfetmek gerekmez ve spam olarak nitelendirilirler. Bir oyun başlığına biraz düşünce katın.\n\n[b]2. Zaten var olan oyunun aynısını tekrar yaratmayın.[/b]\nLütfen bir oyun konusu açmadan önce açacağınız oyununuzun daha önce açılmamış olduğundan emin olun.\n\n[b]3. Bu konuda sadece forum oyunları konularını açabilirsiniz.[/b]\nBaşka şeyler hakkında konuşmak istiyorsanız Tartışmalar ya da Konu Dışı subforumlarını kullanabilirsiniz.\n\nSon olarak, unutmayın ki Forum Oyunları subforumunda da Genel Forum Kuralları geçerlidir.', 'Ciss', '1554146900000', '1554149991000', '0'),
(318, 575, 1, '[p=center][size=35][b][color=#30BA76]Kabile Tanıtım Konusu Oluşturmak[/color][/b][/size]\n[/p]\nBir kabile tanıtım konusunda nelere dikkat etmeniz gerektiğini, nelerden bahsetmek zorunda olduğunuzu ve bahsedebileceğiniz diğer bilgileri adım adım aşağıdan bulabilirsiniz. Kabile tanıtım konusu açmadan önce mutlaka aşağıdaki bilgileri okuyun!\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 1:[/color] [color=#30BA76]Kabile Adı[/color][/size][/b]\n\nKabilenizin adı konu başlığı olacağı dolayısıyla kabile adında hiçbir şekilde argo/küfür/ideolojik içerikli ibareler geçmemelidir. Konu başlıklarının başına &#34;[Kabile]&#34; etiketini yapmayı unutmayın tabi yapmayadabilirsiniz size kalmış.\n\n[quote=][Kabile] Apocalyptica\n[/quote]\n[quote=][Kabile] Athanasia\n[/quote]\n[hr]\n[b][size=17][color=#BABD2F]Adım 2:[/color]  [color=#30BA76]Kabile Logosu[/color][/size][/b]\n\nKabileniz için hazırlanmış bir logo veya hali hazırda kabilenizle ilişkili bir resim varsa konunun en başına o logoyu koyabilirsiniz. Bu sayede çok daha fazla farenin ilgisini çekmiş olacaksınız.\n\n[spoiler][p=center][img]https://i.hizliresim.com/RPRNGR.png[/img][/p][/spoiler]\nKabile tanıtım konunuz okunduğu zaman sıcak ve samimi bir kabile olduğunuzu kanıtlayın. Her fare, güzel bir hoşgeldin ile konunuzu okumaya başlamak ister.\n\n[quote=Kmlcan]Merhaba, ismi Athanasia olan kabilemin tanıtım konusuna hoş geldiniz.[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 4:[/color]  [color=#30BA76]Misyon[/color][/size][/b]\n\nKabilenizin, bugün hangi konumda olduğunu, ne zaman kurulduğunu, kabilenizin adının neden XX olduğunu, ne yaptığınızı (kabile içi etkinlikler, sohbetler), kimin için ve kimlerle nasıl kurma kararı aldığınızı açıklayın.\n\n[quote=Apocalyptica]Kabilemiz 19.06.2017 tarihinde açılmış olup 06.07.2017 tarihinde faaliyete geçmiştir.[/quote]\n\n[quote=Apocalyptica]Kabilemizde eğlenceli aktiviteler bulunmaktadır bunların bazıları şunlardır kar topu savaşı, balık atma savaşı gibi..[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 5:[/color]  [color=#30BA76]Vizyon[/color][/size][/b]\n\nKabilenizin ilerleyen zamanlarda nerede olmayı arzu ettiğini (hatta hayal ettiğini) anlatın. Dünya sıralamasında ilk 20&#39;ye girmek, minioyun veya modül oyun farelerinin hepsini toplamak veya en güzel arkadaş grubuna sahip olarak kıskanılacak bir düzeyde kabile olmak. Bu bölüm tamamen hayal gücünüzü devreye koymanız gereken bir bölüm.\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 6:[/color]  [color=#30BA76]Kurallar[/color][/size][/b]\n\nKabilenize katılacak bir oyuncunun kabile içerisindeyken takip etmesi gereken kurallar var ise yazmalısınız. Argo konuşmamak, kabile evinde çökertici haritalar açmamak, kabile evinde müzik açmak için sıra beklemek, kabiledekilerin odasına izinsiz gitmemek gibi.\n\n[quote=P R I V A C Y]• Kabile içerisinde Küfür/Argo, Spam/Flood kullanımı yasaktır.\n• Kabile üyeleri ile iyi geçinmeli, tartışmadan uzak durmalısınız.\n• Eğlenmeyi bildiğiniz kadar durmayı da bilmelisiniz.\n• Kabile içindeki luayı bozmamalısınız.\n• İzinsiz lua kodlaması yapmamalısınız[/quote]\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 7:[/color]  [color=#30BA76]Yetkili Listesi[/color][/size][/b]\n\nKabilenizin kim tarafından açıldığı ve kim(ler) tarafından yönetildiğini açıklayın. Bir kabileye katılmak istemenin en önemli sebebi sahip olduğu yöneticilerdir.\n\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 8:[/color]  [color=#30BA76]Katılım Koşulları ve Alım Yöntemleri[/color][/size][/b]\n\nHer kabilenin kendisine göre alım şartları vardır. Başvuran veya almak istediğiniz bir oyuncuyla daha sonra sorun yaşamamak adına oyuncuda belirli nitelikler arıyor olmalısınız; 18 yaşından büyük olmak, en az 1.000 birinciliğe sahip olmak, küfür etmemek, tamamen olgun bir kişiliğe sahip olmak gibi. \n\nKoşulları sağlayan oyuncuları neye göre alacağınızdan bahsedin. Kabile içi genel bir oylama yaptığınızdan bahsedebilir veya kabile içerisinde bir oyuncunun istemediği birini kabileye almadığınızı anlatabilirsiniz.\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 9:[/color]  [color=#30BA76]Rütbelendirme ve Fırsatlar[/color][/size][/b]\n\nKabilenize katılacak bir oyuncunun ne isimde rütbe-yetkilere ve kazanabileceği fırsatlara sahip olabileceğinden bahsedin. Her oyuncu katıldığı bir kabilede, en azından kabile evinde bir harita açma yetkisine sahip olmak ister. Ayrıca kabile içerisindeki durumuna göre terfi edebilecekleri durumlardan bahsedin. \n\n\n[hr]\n[b][size=17][color=#BABD2F]Adım 10:[/color]  [color=#30BA76]Güncel Resimler veya Anılar[/color][/size][/b]\n\nKabilecek yaptığınız komik bir sohbetin, bir videonun, kabilecek tüm oyuncularla çekindiğiniz güncel bir resmin, bir ilginç anın veya sırf anı olsun diye çektiğiniz fotoğrafları konunuza ekleyebilirsiniz. Böylece kabilenizi daha çekici hale getirebilirsiniz.', 'Ciss', '1554146946000', '0', '0');
